def _load_dfgt(csvGT):
    csvGTF = io.StringIO(csvGT)
    dfGT = pd.read_csv(csvGTF)
    dfGT.set_index("j_offset", inplace=True)
    for col in J_LISTTYPE_COLUMNS:
        dfGT[col] = dfGT[col].apply(eval)
    return dfGT


def _plot_array(arr):
    import matplotlib.pyplot as plt

    plt.pcolor(arr.T, edgecolors="k", linewidth=2)
    plt.show()


def _save(arr):
    np.savetxt("tmp.txt", arr, fmt="%i", delimiter=" ")


class TestBass35(unittest.TestCase):
    clas = Bass35
    encodingGT = haydnBass35GT
    dfFeature = "a_bass"

    def setUp(self):
        self.df = _load_dfgt(haydn)
        self.timesteps = len(self.df.index)

    def test_encoding(self):
        encoding = self.clas(self.df).array
        encodingGT = np.array(self.encodingGT, dtype="i1")
        for timestep in range(self.timesteps):
            with self.subTest(timestep=timestep):
                ar = np.nonzero(encoding[timestep])
                arGT = np.nonzero(encodingGT[timestep])
                self.assertEqual(tuple(ar[0]), tuple(arGT[0]))

    def test_decoding(self):
        encoding = self.clas(self.df).array
        decoded = self.clas.decode(encoding)
        for timestep, (gt, x) in enumerate(
            zip(self.df[self.dfFeature], decoded)
        ):
            with self.subTest(timestep=timestep):
                self.assertEqual(gt, x)


